calculator.setState(state);

showProtractor = calculator.HelperExpression({ latex: "s_{howProtractor}" });
showProtractor.observe("numericValue", () => {
  if (showProtractor.numericValue % 2 === 0) {
    calculator.setExpression({ id: "2", hidden: true });
    calculator.setExpression({ id: "52", hidden: true });
    calculator.setExpression({ id: "64", hidden: true });
  } else {
    calculator.setExpression({ id: "2", hidden: false });
    calculator.setExpression({ id: "52", hidden: false });
    calculator.setExpression({ id: "64", hidden: false });
  }
});

